import React, { useState, useEffect } from 'react';
import {
  Layout,
  Table,
  Card,
  Button,
  Row,
  Col,
  message,
  Typography,
  Badge,
} from 'antd';
import {
  CalendarOutlined,
  FormOutlined,
  SettingOutlined,
} from '@ant-design/icons';
import ScheduleRepair from './ScheduleRepair';
import axios from 'axios';

const { Content, Footer } = Layout;
const { Title } = Typography;

const Dashboard = () => {
  const [dataSource, setDataSource] = useState([]);

  // Function to fetch scheduled repairs
  const fetchScheduledRepairs = async () => {
    try {
      const account = JSON.parse(localStorage.getItem('account') || '{}');
      if (!account || !account.token) {
        message.error('Authorization token is missing. Please log in.');
        return;
      }

      const response = await axios.get(
        'http://localhost:5235/api/ScheduledRepairs/myrepairs',
        {
          headers: {
            Authorization: `Bearer ${account.token}`,
          },
        }
      );

      const repairs = response.data;

      // Map repairs to match table data format
      const formattedRepairs = repairs.map((repair) => ({
        key: repair.id,
        title: repair.title,
        description: repair.description,
        repairDate: new Date(repair.repairDate).toLocaleString(),
        status: repair.status,
      }));

      setDataSource(formattedRepairs);
    } catch (error) {
      console.error('Error fetching scheduled repairs:', error);
      message.error('Failed to fetch scheduled repairs.');
    }
  };

  // Fetch data when component mounts
  useEffect(() => {
    fetchScheduledRepairs();
  }, []);

  // Table columns
  const columns = [
    {
      title: 'Title',
      dataIndex: 'title',
      key: 'title',
      render: (text) => <strong>{text}</strong>,
    },
    {
      title: 'Description',
      dataIndex: 'description',
      key: 'description',
      ellipsis: true,
    },
    { title: 'Repair Date', dataIndex: 'repairDate', key: 'repairDate' },
    {
      title: 'Status',
      dataIndex: 'status',
      key: 'status',
      render: (status) => {
        let color = 'processing';
        if (status === 'Pending') {
          color = 'warning';
        } else if (status === 'In Progress') {
          color = 'processing';
        } else if (status === 'Completed') {
          color = 'success';
        }
        return <Badge status={color} text={status} />;
      },
    },
  ];

  return (
    <Layout style={{ minHeight: '100vh', backgroundColor: '#f0f2f5' }}>
      {/* Content */}
      <Content
        style={{
          padding: '50px 20px',
          maxWidth: '1200px',
          margin: '0 auto',
          backgroundColor: '#f0f2f5',
        }}
      >
        <div style={{ maxWidth: '1200px', margin: '0 auto' }}>
          <Title
            level={2}
            style={{
              textAlign: 'center',
              marginBottom: '40px',
              fontFamily: 'Roboto, sans-serif',
            }}
          >
            Welcome to Your Dashboard
          </Title>

          {/* Cards */}
          <Row gutter={[24, 24]} style={{ marginBottom: '40px' }}>
            <Col xs={24} sm={12} md={12}>
              <Card
                hoverable
                cover={
                  <img
                    alt="Schedule Repair Appointment"
                    src="https://cdn.pixabay.com/photo/2016/11/29/06/15/desk-1867761_960_720.jpg"
                    style={{
                      objectFit: 'cover',
                      height: '200px',
                      borderRadius: '8px 8px 0 0',
                    }}
                  />
                }
                bodyStyle={{
                  padding: '20px',
                  textAlign: 'center',
                  backgroundColor: '#f7f7f7',
                }}
              >
                <Card.Meta
                  title="Schedule Repair Appointment"
                  description={
                    <ScheduleRepair fetchScheduledRepairs={fetchScheduledRepairs} />
                  }
                />
              </Card>
            </Col>
            <Col xs={24} sm={12} md={12}>
              <Card
                hoverable
                cover={
                  <img
                    alt="Submit a Request"
                    src="https://cdn.pixabay.com/photo/2017/02/01/10/22/gear-2030396_960_720.png"
                    style={{
                      objectFit: 'cover',
                      height: '200px',
                      borderRadius: '8px 8px 0 0',
                    }}
                  />
                }
                bodyStyle={{
                  padding: '20px',
                  textAlign: 'center',
                  backgroundColor: '#f7f7f7',
                }}
              >
                <Card.Meta
                  title="Submit a Request"
                  description={
                    <Button type="primary" style={{ marginTop: '10px' }}>
                      Submit Now
                    </Button>
                  }
                />
              </Card>
            </Col>
          </Row>

          {/* Table */}
          <Title
            level={3}
            style={{
              marginBottom: '20px',
              fontFamily: 'Roboto, sans-serif',
            }}
          >
            Your Appointments
          </Title>
          <Table
            dataSource={dataSource}
            columns={columns}
            pagination={{ pageSize: 5 }}
            style={{
              backgroundColor: '#fff',
              padding: '20px',
              borderRadius: '8px',
              boxShadow: '0px 4px 8px rgba(0, 0, 0, 0.1)',
            }}
          />
        </div>
      </Content>

      {/* Footer */}
      <Footer style={{ textAlign: 'center', padding: '20px 50px' }}>
        Employment Hub Â©2023 Created by Your Company
      </Footer>
    </Layout>
  );
};

export default Dashboard;
